import React from "react";
import Logo from "../../img/bottle1.png";
import Productone from "../../img/logo1.png";
import "./List.css";

const items = [
  {
    id: 1,
    imageUrl: Logo,
    title: "Item 1",
    imageUrl1: Productone,
    title2: "Item 2",
    description: "This is the first item in the list",
  },
  {
    id: 2,
    imageUrl: Productone,
    title: "Item 2",
    imageUrl1: Productone,
    title2: "Item 2",
    description: "This is the second item in the list",
  },
  //...
];

function Item(props) {
  return (
    <div className="item">
      <img
        src={props.imageUrl1}
        alt={props.title1}
        style={{ width: "50px", height: "100px" }}
      />
      <h3>{props.title}</h3>
      <img
        src={props.imageUrl2}
        alt={props.title2}
        style={{ width: "50px", height: "100px" }}
      />
      <p>{props.description}</p>
    </div>
  );
}

function ListView(props) {
  return (
    <div className="list-view">
      {items.map((item) => (
        <Item
          key={item.id}
          imageUrl1={item.imageUrl1}
          title1={item.title1}
          imageUrl2={item.imageUrl2}
          title2={item.title2}
          description={item.description}
        />
      ))}
    </div>
  );
}

const List = () => {
